import { useState } from 'react';
import './App.css';

function App() {

// let curtime = new Date().toLocaleTimeString();  
let curtime = 0;
const [curval, setval] = useState(curtime);

  const myTimerFun = ()=>{
    setval(curval+1);       
  }

  return(
    <>
    <h1>{curval}</h1>
    <button onClick={myTimerFun}>Click here</button>
    </>
  );
}

export default App;
